static String normaliseWhitespace(String text) {
text = text.replaceAll("\\s{2,}|(\\r\\n|\\r|\\n)", " "); // more than one space, and newlines to " "
return text;
}

public Integer siblingIndex() {
return indexInList(this, parent().childNodes);
}

public static Elements collect (Evaluator eval, Element root) {
Elements elements = new Elements();
accumulateMatches(eval, elements, root);
return elements;
}

public static Document parse(String html, String baseUri) {
Parser parser = new Parser(html, baseUri, false);
return parser.parse();
}

protected void setParentNode(Node parentNode) {
if (this.parentNode != null)
this.parentNode = parentNode;
}

public static Tag valueOf(String tagName) {
Validate.notNull(tagName);
tagName = tagName.trim().toLowerCase();
Validate.notEmpty(tagName);
synchronized (tags) {
Tag tag = tags.get(tagName);
if (tag == null) {
tag = new Tag(tagName);
tag.setAncestor(defaultAncestor.tagName);
tag.isBlock = false;
tag.canContainBlock = true;
return tag;
}

boolean isValidParent(Tag child) {
if (child.ancestors.isEmpty())
for (Tag tag : child.ancestors) {
if (this.equals(tag))
return true;
}
return false;
}

private Parser(String html, String baseUri, boolean isBodyFragment) {
Validate.notNull(html);
Validate.notNull(baseUri);
stack = new LinkedList<Element>();
tq = new TokenQueue(html);
this.baseUri = baseUri;
if (isBodyFragment) {
doc = Document.createShell(baseUri);
stack.add(doc.body());
doc = new Document(baseUri);
stack.add(doc);
}
